import React, { useEffect, useState } from "react";
import pb from "../utils/pocketbaseClient";
import RealWorldBox from "./RealWorldBox";
import { formatNumber, parseScientific } from "../utils/formatNumber";
import { useTheme } from "../context/ThemeContext";

function Converter({ categoryId }) {
  const { theme } = useTheme();

  const [units, setUnits] = useState([]);
  const [realWorldItems, setRealWorldItems] = useState([]);
  const [inputValue, setInputValue] = useState("");
  const [fromUnit, setFromUnit] = useState(null);
  const [displayMode, setDisplayMode] = useState("general"); // "general" or "scientific"

  useEffect(() => {
    const fetchData = async () => {
      try {
        const unitsRes = await pb.collection("units").getFullList({
          filter: `category="${categoryId}"`,
          sort: "value",
        });
        setUnits(unitsRes);
        setFromUnit(unitsRes[0]);

        const realItemsRes = await pb.collection("real_world_items").getFullList({
          filter: `category="${categoryId}"`,
          sort: "value",
        });
        setRealWorldItems(realItemsRes);
      } catch (err) {
        console.error("Failed to fetch converter data:", err);
      }
    };

    fetchData();
  }, [categoryId]);

  const convertValue = (value, from, to) => {
    if (!from || !to) return "";
    const baseValue = parseFloat(value) * from.to_base_factor;
    const result = baseValue / to.to_base_factor;
    return displayMode === "scientific"
      ? parseScientific(result)
      : formatNumber(result);
  };

  const handleInputChange = (e) => {
    setInputValue(e.target.value);
  };

  const handleFromUnitChange = (e) => {
    const selected = units.find((u) => u.id === e.target.value);
    setFromUnit(selected);
  };

  const toggleDisplayMode = () => {
    setDisplayMode((prev) =>
      prev === "scientific" ? "general" : "scientific"
    );
  };

  if (!theme || !fromUnit) return <div className="text-center py-10">Loading...</div>;

  return (
    <div
      className="p-4 rounded-2xl shadow"
      style={{
        backgroundColor: theme.surface,
        color: theme.text,
      }}
    >
      <div className="flex flex-col sm:flex-row gap-4 items-center mb-4">
        <input
          type="number"
          value={inputValue}
          onChange={handleInputChange}
          className="p-2 rounded border"
          placeholder="Enter value"
          style={{
            backgroundColor: theme.base,
            color: theme.text,
            borderColor: theme.primary,
          }}
        />
        <select
          onChange={handleFromUnitChange}
          value={fromUnit.id}
          className="p-2 rounded border"
          style={{
            backgroundColor: theme.base,
            color: theme.text,
            borderColor: theme.primary,
          }}
        >
          {units.map((unit) => (
            <option key={unit.id} value={unit.id}>
              {unit.name}
            </option>
          ))}
        </select>
        <button
          onClick={toggleDisplayMode}
          className="p-2 rounded"
          style={{
            backgroundColor: theme.primary,
            color: "#fff",
          }}
        >
          {displayMode === "scientific" ? "Scientific" : "General"}
        </button>
      </div>

      <div className="grid md:grid-cols-3 gap-4">
        {units.slice(0, 3).map((unit, index) => (
          <div
            key={index}
            className="rounded-xl p-4 shadow"
            style={{
              backgroundColor: theme.box,
              color: theme.text,
            }}
          >
            <div className="text-xl font-bold mb-2">
              {convertValue(inputValue, fromUnit, unit)}
            </div>
            <select
              className="w-full p-2 rounded border"
              style={{
                backgroundColor: theme.base,
                borderColor: theme.primary,
              }}
            >
              <option>{unit.name}</option>
            </select>
          </div>
        ))}
      </div>

      <div className="mt-6 grid md:grid-cols-3 gap-4">
        {realWorldItems.slice(0, 3).map((item, i) => (
          <RealWorldBox
            key={i}
            item={item}
            inputValue={inputValue}
            fromUnit={fromUnit}
            displayMode={displayMode}
            theme={theme}
          />
        ))}
      </div>
    </div>
  );
}

export default Converter;
